export default class Home extends Component {
  static async getInitialProps({ pathname }) {
    return { pathname }
  }

  render() {
    console.log(this.pathname)
    return (
      <div className={styles.container}>
        <Header />
        <Main />
        <TabBar />
      </div>
    );
  }
}
